import React from "react";
import { Route, Switch, Redirect, useHistory } from "react-router-dom";
import Login from "./Login";
import Register from "./Register";
import * as auth from "../utils/auth.js";
import AroundUs from "./AroundUs";
import ProtectedRoute from "./ProtectedRoute";
import InfoTooltip from "./InfoTooltip";

function App() {
  //login
  const [loggedIn, setLoggedIn] = React.useState(false);
  const [authPopupState, setAuthPopupState] = React.useState(false);
  const [mode, setMode] = React.useState(false);
  const [message, setMessage] = React.useState({ message: "" });

  //userInfo
  const [userEmail, setUserEmail] = React.useState("");
  const [userPassword, setUserPassword] = React.useState("");
  const [registered, setRegistered] = React.useState(false);
  const [token, setToken] = React.useState(localStorage.getItem("token"));

  const history = useHistory();

  //resetForm
  function resetForm() {
    setUserEmail("");
    setUserPassword("");
  }

  //login
  function closePopup() {
    setAuthPopupState(false);
  }

  function renderSuccess() {
    setMode(true);
    setAuthPopupState(true);
    setMessage({ message: "¡Correcto! Ya estás registrado." });
  }

  function renderFailure() {
    setMode(false);
    setAuthPopupState(true);
    setMessage({
      message: "Uy, algo salió mal. Por favor, inténtalo de nuevo.",
    });
  }

  function authorize(e) {
    e.preventDefault();
    auth
      .authorize(userEmail, userPassword)
      .then((data) => {
        if (data && data.token) {
          setToken(data.token);
          localStorage.setItem("token", data.token);
          history.push("/main");
          setLoggedIn(true);
        } else {
          resetForm();
          if (!userEmail || !userPassword) {
            renderFailure();
            throw new Error("400 - Uno o mas de los valores no se han llenado");
          }
        }
        if (!data) {
          renderFailure();
          throw new Error("Uy, algo salió mal.");
        }
      })
      .catch((err) => {
        console.log(err);
      });
  }

  //signup
  function register(e) {
    e.preventDefault();
    auth
      .register(userEmail, userPassword)
      .then((res) => {
        if (!(res && res._id)) {
          renderFailure();
          if (res.status === 409) {
            return Promise.reject(new Error("(Conflict) - User already taken"));
          }
        }
        renderSuccess();
      })
      .then((res) => {
        setRegistered(true);
        history.push("/signin");
        return res;
      })
      .then(resetForm)
      .catch((err) => {
        console.log(err);
      });
  }

  //logout
  function signOut() {
    localStorage.removeItem("jwt");
    setLoggedIn(false);
    setUserEmail("");
    history.push("/signin");
  }

  ReactuseEffect(() => {
    // const token = localStorage.getItem("jwt");
    if (token) {
      auth
        .checkToken(token)
        .then((res) => {
          if (res) {
            setLoggedIn(true);
            setAccountData(res.data);
            history.push("/");
          }
        })
        .catch((err) => console.log(err));
    }
  }, [history]);

  return (
    <div className="page">
      <Switch>
        <ProtectedRoute
          path="/main"
          loggedIn={loggedIn}
          email={userEmail}
          component={AroundUs}
          signOut={signOut}
          closePopup={closePopup}
          message={message}
          mode={mode}
          setUserEmail={setUserEmail}
        />
        <Route path="/signin">
          <div className="loginContainer">
            <Login
              loggedIn={loggedIn}
              title="Iniciar Sesión"
              value="¿Aún no eres miembro? Regístrate aquí"
              link="/signup"
              redirect="Regístrate"
              setLoggedIn={setLoggedIn}
              signOut={signOut}
              renderFailure={renderFailure}
              renderSuccess={renderSuccess}
              authorize={authorize}
              userEmail={userEmail}
              userPassword={userPassword}
              setUserEmail={setUserEmail}
              setUserPassword={setUserPassword}
            />
            <InfoTooltip
              popupState={authPopupState}
              closePopup={closePopup}
              message={message}
              mode={mode}
            />
          </div>
        </Route>
        <Route path="/signup">
          <div className="registerContainer">
            <Register
              loggedIn={loggedIn}
              title="Regístrate"
              value="¿Ya eres miembro? Inicia sesión aquí"
              link="/signin"
              redirect="Inicia sesión"
              setLoggedIn={setLoggedIn}
              signOut={signOut}
              renderFailure={renderFailure}
              renderSuccess={renderSuccess}
              register={register}
              userEmail={userEmail}
              userPassword={userPassword}
              setUserEmail={setUserEmail}
              setUserPassword={setUserPassword}
            />
            <InfoTooltip
              popupState={authPopupState}
              closePopup={closePopup}
              message={message}
              mode={mode}
            />
          </div>
        </Route>
        <Route>
          {loggedIn ? <Redirect to="/main" /> : <Redirect to="/signin" />}
        </Route>
      </Switch>
    </div>
  );
}

export default App;
